// FormComponent.js
import './loginform.css';
import React, { useState } from 'react';
import { useEffect } from 'react';
//import dgram from 'dgram';  
const FormComponent = () => {
  const [cropInfo, setCropInfo] = useState('wheat');
  const [formData, setFormData] = useState({
    Nitrogen: '',
    Phosphorus: '',
    Potassium: '',
    Humidity: '',
    PH_values: '',
    Rainfall: '',
    Temperature: '',
  });

  const handleChange = (e) => {
    setFormData({
      ...formData,
      [e.target.name]: e.target.value,
    });
  };

  const handleSubmit = (e) => {
    e.preventDefault();

    // Convert formData to JSON
    const formDataJson = JSON.stringify(formData);
    
    // Display form data in console
    console.log(formDataJson);
    const { Nitrogen, Phosphorus, Potassium } = formData;
    // Check if Nitrogen, Phosphorus, and Potassium values are provided and update cropType accordingly
    if (Nitrogen === '120' && Phosphorus === '40' && Potassium === '40') {
      setCropInfo("Rice");
    } else if (Nitrogen === '80' && Phosphorus === '40' && Potassium === '20'){
      setCropInfo("Maize"); // Set to default crop type if conditions are not met
    }
    else if (Nitrogen === '120' && Phosphorus === '60' && Potassium === '40'){
      setCropInfo("Wheat"); // Set to default crop type if conditions are not met
    }
    else if (Nitrogen === '620' && Phosphorus === '310' && Potassium === '620'){
      setCropInfo("Banana"); // Set to default crop type if conditions are not met
    }
    else if (Nitrogen === '75' && Phosphorus === '' && Potassium === '40'){
      setCropInfo("maize"); // Set to default crop type if conditions are not met
    }
  
    // You can perform further actions with the form data here
  };
  
  return (
    <div>
    <div className="container">
      <h1 className="form-title">Soil Macronutrients</h1>
      <form id="registrationForm" onSubmit={handleSubmit}>
        <div className="main-user-info">
          <div className="user-input-box">
            <label htmlFor="Nitrogen">Nitrogen</label>
            
            <input
              type="float"
              id="Nitrogen"
              name="Nitrogen"
              placeholder="Enter Nitrogen values"
              value={formData.Nitrogen}
              onChange={handleChange}
            />
          </div>
          <div className="user-input-box">
            <label htmlFor="Nitrogen">Phosphorus</label>
            <input
              type="float"
              id="Phosphorus"
              name="Phosphorus"
              placeholder="Enter Phosphorus values"
              value={formData.Phosphorus}
              onChange={handleChange}
            />
          </div>
          <div className="user-input-box">
            <label htmlFor="Nitrogen">Potassium</label>
            <input
              type="float"
              id="Potassium"
              name="Potassium"
              placeholder="Enter Potassium values"
              value={formData.Potassium}
              onChange={handleChange}
            />
          </div>
          <div className="user-input-box">
            <label htmlFor="Nitrogen">Humidity</label>
            <input
              type="float"
              id="Humidity"
              name="Humidity"
              placeholder="Enter Humidity values"
              value={formData.Humidity}
              onChange={handleChange}
            />
          </div>
          <div className="user-input-box">
            <label htmlFor="Nitrogen">PH_Values</label>
            <input
              type="float"
              id="PH_Values"
              name="PH_Values"
              placeholder="Enter PH_Values values"
              value={formData.PH_Values}
              onChange={handleChange}
            />
          </div>
          <div className="user-input-box">
            <label htmlFor="Nitrogen">Rainfall</label>
            <input
              type="float"
              id="Rainfall"
              name="Rainfall"
              placeholder="Enter Rainfall values"
              value={formData.Rainfall}
              onChange={handleChange}
            />
          </div>
          <div className="user-input-box">
            <label htmlFor="Nitrogen">Temperature</label>
            <input
              type="float"
              id="Temperature"
              name="Temperature"
              placeholder="Enter Temperature values"
              value={formData.Temperature}
              onChange={handleChange}
            />
          </div>
          {/* Add other input fields similarly */}
        </div>
        <div className="form-submit-btn">
          <input type="submit" value="Submit" />
        </div>
      </form>
      
      </div>
      <div className="container1">
      <div className="suitable">
        <h1 className="form-title">Suitable crop type : {cropInfo}</h1>
       
      </div>
      </div>
    </div>
  );
};

export default FormComponent;
